import React from 'react';
import { Dialog, DialogActions, DialogContent, DialogTitle, Typography, Button } from '@mui/material';

const DialogComponent = ({ 
  open, 
  onClose, 
  title, 
  titleColor, 
  content, 
  actions,
  maxWidth = "sm",
  fullWidth = true
}) => {
  return (
    <Dialog
      open={open}
      onClose={onClose}
      aria-labelledby="dialog-title"
      maxWidth={maxWidth}
      fullWidth={fullWidth}
    >
      <DialogTitle id="dialog-title" sx={{ bgcolor: titleColor, color: 'white' }}>
        <Typography variant="h6">{title}</Typography>
      </DialogTitle>
      <DialogContent dividers>
        {content}
      </DialogContent>
      <DialogActions>
        {actions}
      </DialogActions>
    </Dialog>
  );
};

export default DialogComponent;
